    object_json_repr: '[{"model": "aristotle_mdr_help.concepthelp", "pk": 21, "fields":
      {"concept_type": "objectclass", "brief": "A definition for classifying a set
      of real objects, ideas or events that all share common measurable attributes",
      "offical_definition": "Set of ideas, abstractions or things in the real world
      that are identified with explicit boundaries and meaning and whose properties
      and behaviour follow the same rules\n", "official_reference": "ISO/IEC 11179
      - Clause 3.2.88", "official_link": null, "creation_tip": "Object classes are
      <em>things</em> we wish to collect information about. Good names for object
      classes are short, descriptive nouns. <ul>\n  <li><strong>Be generic:</strong>
      An object class should apply to the widest group possible.\n  Only make more
      specific classes, if there are particular attributes only found on the specialisation.\n  e.g.
      Person, not Australian Citizens</li>\n  <li><strong>Use singlar forms:</strong>
      When discusing individuals, use singular terms to ensure unambiguity. For example,
      a <em>Person</em> can have an age, but a <em>Group of people</em> has an average
      age.</li>\n  <!--  <li><strong>:</strong></li> -->\n</ul>\n<!-- If you are unsure,
      use the name of your object class in the contexts below. <ul>\n  <li>Measure
      of the age of <em>noun.</em></li>\n  <li>Comparing the yearly income of <em>nouns</em>
      and private companies</li>\n</ul> In these examples, <q>Comparing the yearly
      income of <em>Persons</em> and private companies</q> makes sense, but <q>Measure
      of the age of <em>Wages.</em></q> does not - wages is an attribute of people
      or businesses.-->"}}]'
    object_repr: ConceptHelp object
